    public static void nextPermutation(ArrayList<Integer> a) {
        if(a==null || a.size()<=1){
            return;
        }
        ArrayList<Integer> bag=new ArrayList<Integer> ();
        int maxTillNow=a.get(a.size()-1);
        bag.add(a.get(a.size()-1));
        a.remove(a.size()-1);

        while(a.size()>0){
            int num=a.get(a.size()-1);
            if(maxTillNow>num){
                //magic;
                break;
            }else{
                bag.add(num);
                a.remove(a.size()-1);
                if(num>maxTillNow){
                     maxTillNow=num;
                }
            }
        }
        //let the magic begin
        if(a.size()!=0){
            int numFlick=a.get(a.size()-1);
            Collections.sort(bag);
            for(int i=0;i<bag.size();i++){
                if(bag.get(i)>numFlick){
                    //swap and return
                    a.set(a.size()-1,bag.get(i));
                    bag.set(i,numFlick);
                    a.addAll(bag);
                    return;
                }
            }
        }else{
            a.addAll(bag);
        }
        return;
    }

    public static int firstMissingPositiveN(ArrayList<Integer> A) {
        if(A==null || A.size()==0){
            return 1;
        }
        int size=A.size();
        for(int i=0;i<A.size();i++){
            if(A.get(i)<0 || A.get(i)>size){
                A.set(i,0);
            }
        }

        for(int i=0;i<A.size();i++){
            int tmp=A.get(i);
            if(tmp>0 ){
                if(A.get(tmp-1)>0){
                    A.set(tmp-1,-1*A.get(tmp-1));
                }else if(A.get(tmp-1)==0){
                    A.set(tmp-1,Integer.MIN_VALUE);
                }
            }else if(tmp!=Integer.MIN_VALUE&& tmp!=0){
                tmp=-1*tmp;
                if(A.get(tmp-1)>0){
                    A.set(tmp-1,-1*A.get(tmp-1));
                }else if(A.get(tmp-1)==0){
                    A.set(tmp-1,Integer.MIN_VALUE);
                }
            }
        }

        for(int i=0;i<A.size();i++){
            if(A.get(i)>=0){
                return i+1;
            }
        }
        return A.size()+1;
    }

    public static ArrayList<Integer> maxset(ArrayList<Integer> A) {
        long maxSum=0;
        ArrayList<Integer> maxList=new ArrayList<Integer>();
        int length=0;
        int minSid=Integer.MAX_VALUE;
        if (A==null || A.size()==0){
            return maxList;
        }

        long localSum=0;
        ArrayList<Integer> localMaxList=new ArrayList<Integer>();
        int localSid=Integer.MAX_VALUE;
        for(int i=0;i<A.size();i++){
            if(A.get(i)>=0){
                if(i<localSid){
                    localSid=i;
                }
                localSum+=A.get(i);
                localMaxList.add(A.get(i));
            }else{
                if(localSum >maxSum){
                    maxSum=localSum;
                    maxList=localMaxList;
                    minSid=localSid;
                }else if(localSum == maxSum){
                    maxSum=localSum;
                    if(localMaxList.size()>maxList.size()){
                        maxList=localMaxList;
                        minSid=localSid;
                    }else if(localMaxList.size()==maxList.size() && localSid<minSid){
                        maxList=localMaxList;
                        minSid=localSid;
                    }
                }
                localSum=0;
                localMaxList=new ArrayList<Integer>();
                localSid=Integer.MAX_VALUE;
            }
        }
        if(localSum >maxSum){
            maxSum=localSum;
            maxList=localMaxList;
            minSid=localSid;
        }else if(localSum == maxSum){
            maxSum=localSum;
            if(localMaxList.size()>maxList.size()){
                maxList=localMaxList;
                minSid=localSid;
            }else if(localMaxList.size()==maxList.size() && localSid<minSid){
                maxList=localMaxList;
                minSid=localSid;
            }
        }
        return maxList;
    }

    public static ArrayList<Long> getRow(int A) {

        ArrayList<Long> pascal=new ArrayList<Long>();
        if(A<=0){
            return pascal;
        }
        pascal.add(1l);
        if(A==0){
            return pascal;
        }
        pascal.add(1l);
        if(A==1){
            return pascal;
        }
        pascal=new ArrayList<Long>();
        for(int i=0;i<=A;i++){
            pascal.add((ncr(A, i)));
        }
        return pascal;
    }

    public static long ncr(int n,int r){
        if(r>n/2){
            r=n-r;
        }
        long nfact=1,rfact=1;
        for(int i=0; i<r; i++){
            nfact *=(n-i);
            rfact *=(i+1);
        }
        return nfact/rfact;
    }

